vis03['introduction'] = `Atualmente, as Nações Unidas estimam que menos de <b>30%</b> dos pesquisadores em áreas científicas e tecnológicas sejam mulheres.
    Habilidades em ciência, tecnologia, engenharia e matemática, conhecidas pela sigla STEM em inglês, serão fundamentais em economias marcadas 
	pelo avanço da tecnologia. Diante disso, buscamos visualizar como se encontra a participação de homens e mulheres em cada curso.`
vis03['question'] = 'Qual a taxa de participação feminina e masculina em cada curso?';
vis03['comment'] = `Como podemos verificar na visualização a seguir, os cursos das áreas de STEM, situados mais à esquerda, possuem uma participação feminina reduzida.
    Isso chama a atenção para a necessidade da elaboração de políticas públicas que incentivem a participação das mulheres nessas áreas, reduzindo as desigualdades entre os sexos e ampliando a diversidade entre as diferentes áreas do conhecimento.`;

