vis04['introduction'] = `Segundo a coordenadora de Igualdade Racial do Instituto de Pesquisas Econômicas e Administrativas (IPEA), Tatiana Dias Silva: 
<i>"Existem temores de que as ações afirmativas criariam um 'racismo ao contrário'. Os dados disponíveis desmentem tudo isso."</i>`;
vis04['question'] = 'Qual a distribuição de alunos por raça?';
