vis06['introduction'] = 'No que diz respeito à situação de trabalho dos concluintes, existe uma grande concentração de estudantes nos dois extremos das categorias apresentadas no questionário. <b>A maioria dos estudantes (mais de 70%) está dividida entre as categorias <i>"Não trabalho"</i> e <i>"Trabalho 40 ou mais horas por semana"</i></b>.'
vis06['question'] = 'Qual a distribuição dos alunos por situação de trabalho?';
vis06['comment'] = 'O gráfico abaixo apresenta a distribuição dos concluintes em cinco categorias que definem sua situação de trabalho. As categorias são: <b>não trabalho</b>, trabalho <b>eventualmente</b>, trabalho até <b>20 horas por semana</b> (hps), trabalho <b>de 20 a 39 horas por semana</b> e <b>trabalho 40 ou mais horas por semana</b>.';

