vis08['introduction'] = 'Ainda sobre a idade dos estudantes, o site <a href="https://querobolsa.com.br/revista/idade-media-dos-estudantes-de-cada-curso" target="_blank">Quero Bolsa</a> realizou uma pesquisa com os dados do censo do Ensino Superior brasileiro referente ao ano de 2015. O  estudo afirma que <i>"os cursos sobre religião e educação atraem, em média, alunos com idade entre 30 e 45 anos"</i>, enquanto que <i>"os cursos relacionados à tecnologia e engenharias atraem alunos com pouco mais de 20 anos, na média"</i>.<br><br>Utilizando os dados do ENADE 2017, resolvemos verificar esse aspecto do perfil dos concluintes.'
vis08['question'] = 'Qual a média da idade dos concluintes por curso?';

