vis30['question'] = 'Como a média da nota geral varia de acordo com as modalidades de bolsas e auxílios?'
vis30['comment'] = `A seguir visualizamos o desempenho médio dos alunos que receberam bolsas e/ou algum tipo de auxílio da universidade. 
Os bolsistas do Programa de Educação Tutorial (PET) e de Iniciação Científica (IC), no geral, apresentaram desempenho superior aos das outras modalidades de bolsas.
Vale mencionar que os alunos que não receberam (ou não participaram) de nenhum programa de bolsas, 
obtiveram um desempenho médio inferior que todas as outras modalidades. Essa visualização também corrobora com o estudo 
publicado no site <a href="http://www.scielo.br/scielo.php?pid=S0102-88392000000100008&script=sci_arttext&tlng=es" target="_blank">Scielo</a>, 
no qual são descritas as vantagens da iniciação científica para uma formação mais completa do aluno.`;

