vis32['question'] = 'Como a média da nota geral varia de acordo com os motivos que levaram à escolha da instituição e do curso?';
vis32['comment'] = `Como podemos visualizar, os alunos que escolheram o curso por <b>vocação</b> e que escolheram a IES pela 
<b>qualidade/reputação</b> apresentaram desempenho superior ao dos demais. Em contrapartida, os alunos que escolheram seu curso por 
<b>prestígio social</b> e sua IES por <b>proximidade do trabalho</b> apresentaram, em média, um desempenho inferior ao dos demais.`;


